import './App.css';
import React, {useState} from 'react';
import ReactMapGL, {Source, Layer} from 'react-map-gl';
import illinois_counties from './illinois_counties.json'

function App() {

  const [viewport, setViewport] = useState({
    latitude: 40.150196,
    longitude: -89.367848, 
    zoom: 6,
    width: "50vw",
    height: "100vh"
  })

  const layer = {
    id: 'counties',
    type: 'fill',
  };

  return (
    <div className="App">
      <ReactMapGL
        {...viewport}
        mapboxApiAccessToken={"pk.eyJ1IjoiZWdhYnJpZWxzZSIsImEiOiJja2d2ZDZua2QwMWI3M2JwajA0Z3lqbDdmIn0.sAaMKjFMEglTFxZwKyU75Q"}
        onViewportChange={(newViewport) => setViewport(newViewport) }
      >
        <Source id="counties" type="geojson" data={illinois_counties}>
          <Layer id= 'counties' type= 'fill' paint={{'fill-color': '#aed6f1', "fill-opacity": 0.5, "fill-outline-color": "#2e86c1"}}></Layer>
        </Source>
      </ReactMapGL>
    </div>
  );
}

export default App;
